import { Link } from "react-router-dom";
import { Button } from "@mui/material";

const FriendDetail = () => {
  return (
    <>
      <h1>Friend_detail_page</h1>
      <Button
        variant="outlined"
        color="primary"
        component={Link}
        to="/friend-detail"
      >Back to friend</Button>
    </>
  );
};
export default FriendDetail;
